import React from 'react';
import './index.css';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';

import { Modal, Button, Form, Input, Select} from 'antd';

const { Option } = Select;

class Formulario extends React.Component {

    state = { visible: false };

    showModal = () => {
        this.setState({
        visible: true,
        });
    };

    handleOk = e => {
        console.log(e);
        this.setState({
        visible: false,
        });
    };

    handleCancel = e => {
        console.log(e);
        this.setState({
        visible: false,
        });
    };
    handleSubmit = e => {
        e.preventDefault();
        this.props.form.validateFields((err, values) => {
        if (!err) {
            console.log('Valores recebidos do formulário: ', values);
        }
        });
    };


  render() {
    const { getFieldDecorator } = this.props.form;
    return (
        <div>
            <h1 className="titulo" >Clientes do sistema</h1>
            <Button type="primary" className="mod" onClick={this.showModal}>
                Cadastrar
            </Button>
            <Modal
                title="Cadastro de cliente"
                visible={this.state.visible}
                onOk={this.handleOk}
                onCancel={this.handleCancel}
            >
            </Modal>

        </div>
    );
  }
}

const WrappedApp = Form.create({ name: 'coordinated' })(Formulario);



class App extends React.Component {
  state = { visible: false };

  showModal = () => {
    this.setState({
      visible: true,
    });
  };

  handleOk = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  handleCancel = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  render() {
    return (
      <div>
        <h1 className="titulo" >Clientes do sistema</h1>
        <Button type="primary" className="mod" onClick={this.showModal}>
          Cadastrar
        </Button>
        <Modal
            title="Cadastro de cliente"
            visible={this.state.visible}
            onOk={this.handleOk}
            onCancel={this.handleCancel}
        >
            <WrappedApp/>
        </Modal>
      </div>
    );
  }
}


ReactDOM.render(<WrappedApp />, document.getElementById('root'));
